import React from 'react';
//Import Icons
import react_logo from '../img/react.svg'; 
import js_logo from '../img/javascript.svg'; 
import java_logo from '../img/java.svg'; 
import sass_logo from '../img/sass.svg'; 
import coding from '../img/coding.jpg';
//Import Styled Components
import styled from 'styled-components';
import {
    StyledAbout,
    StyledDescription,
    StyledImage,
} from '../styles.js';

const ServicesSection = () => {
    return(
        <StyledServices>
            <StyledDescription>
                <h2><span>Frameworks</span> and <span>Languages</span></h2>
                <StyledCards>
                    <StyledCard>
                        <div className="icon">
                            <img src={react_logo} alt="React logo" />
                            <h3>React</h3>
                            <p>Lorem ipsum dolor</p>
                        </div>
                    </StyledCard>
                    <StyledCard>
                        <div className="icon">
                            <img src={js_logo} alt="JavaScript logo" />
                            <h3>JavaScript</h3>
                            <p>Lorem ipsum dolor</p>
                        </div>
                    </StyledCard>
                    <StyledCard>
                        <div className="icon">
                            <img src={java_logo} alt="Java logo" />
                            <h3>Java</h3>
                            <p>Lorem ipsum dolor</p>
                        </div>
                    </StyledCard>
                    <StyledCard>
                        <div className="icon">
                            <img src={sass_logo} alt="Sass logo" />
                            <h3>Sass</h3>
                            <p>Lorem ipsum dolor</p>
                        </div>
                    </StyledCard>
                </StyledCards>
            </StyledDescription>
            <StyledImage>
                <img src={coding} alt="Beep Boop" />
            </StyledImage>
        </StyledServices>
    );
};

const StyledServices = styled(StyledAbout)`
    background: darkgoldenrod;
    h2{
        padding-bottom: 5rem; 
    }
    p{
        width: 70%;
        padding: 2rem 0rem 4rem 0rem;
    }
`;
const StyledCards = styled.div`
    display: flex;
    flex-wrap: wrap;
`;
const StyledCard = styled.div`
    flex-basis: 20rem;
    img{
        width: 9%;
    }
    .icon{
        display: flex;
        align-items: center;
    }
`;

export default ServicesSection;
